package abstractfactory1;

public abstract class PhoneNumber {

	private String name;
	private int number;

	public PhoneNumber() {
		// TODO Auto-generated constructor stub
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	public int getNumber() {
		return number;
	}

	public void setNumber(int number) {
		this.number = number;
	}

}
